import React from 'react';
import { ReviewFormContainer, ReviewFormWrapper, ReviewFormContent, ReviewFormFormField } from './ReviewFormElements';

const ReviewForm = () => {
    return (
        <>
            <ReviewFormContainer>
                <ReviewFormWrapper>
                    <ReviewFormContent>
                        <h1>Hello World</h1>
                    </ReviewFormContent>
                    <ReviewFormFormField>

                    </ReviewFormFormField>
                </ReviewFormWrapper>
            </ReviewFormContainer>
        </>
    )
}

export default ReviewForm
